import CSGO from './Images/CSGO.png';
import './Games.css';
import axios from 'axios';


function Games() {
    const [data, setData] = useState([]);
    var gamesArray;
    var reviewsArray;
    var pricesArray;
    var arrayOfGames;

    const fetchAPI = async() => {
      var stringGames;
      var stringReviews;
      var stringPrices;
      const response = await axios.get("http://127.0.0.1:8080/api/members");
      setData(response.data.games);
      stringGames = String(response.data.games);
      stringReviews = String(response.data.reviewScores);
      stringPrices = String(response.data.prices);

      stringGames = stringGames.replace("[", "").replace("]", "").replace(",", "");
      stringReviews = stringReviews.replace("[", "").replace("]", "").replace(",", "");
      stringPrices = stringPrices.replace("[", "").replace("]", "").replace(",", "");

      const array1 = stringGames.split(/\s(?=")/);
      const array2 = stringReviews.split(/\s(?=")/);
      const array3 = stringPrices.split(/\s(?=")/);
      console.log(array1[2]);

      gamesArray = array1;
      console.log(gamesArray[0])
      reviewsArray = array2;
      pricesArray = array3;
      arrayOfGames = gamesArray.map((game) => <li>{game}</li>);
    };


    //Somewhere around here we need to parse through the strings,
    //remove quotes whenever we find them (as well as []'s), but also
    //use quotes as identifiers for the beginning and end of a string to use.
    

  
    useEffect(() => {
      fetchAPI()
    }, []);

  return (
    <div className = "games">
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <p>Title</p>
                <p>
                    <span>{arrayOfGames}</span>
                </p>
            </div>
            <div className = "Games-Middle">
                <p>Steam Rating</p>
            </div>
            <div className = "Games-Middle">
                <p> Price</p>
            </div>
            <br />
